// export default MyBlog

import posts from '../posts.json'

export default () => (
	<div>
		<h1>Blog</h1>
		<ul>
			{
				Object.entries(posts).map((value, index) => (
					<li key={index}>
						{value[1].title}
					</li>
				))
			}
		</ul>
	</div>
)
